// SBDL ここまで

let lastDataID = null;
let lastDataTitle = null;
let lastDataBlob = null;

class getSb {
  getInfo() {
    return {
      id: 'getsb',
      name: 'GetSB3',
      blocks: [
        {
          opcode: 'getData',
          blockType: Scratch.BlockType.COMMAND,
          text: 'ScratchのプロジェクトID [ID] からデータを取得',
          arguments: {
            ID: {
              type: Scratch.ArgumentType.NUMBER,
              defaultValue: '60917032'
            }
          }
        },
        {
          opcode: 'returnData',
          disableMonitor: true,
          blockType: Scratch.BlockType.REPORTER,
          text: '最後に取得したデータの [DataType] を取得',
          arguments: {
            DataType: {
              type: Scratch.ArgumentType.STRING,
              menu: 'DataT',
            }
          }
        }
      ],
      menus: {
        DataT: [
          {
            text: 'ID',
            value: 'id'
          },
          {
            text: 'タイトル',
            value: 'title'
          },
          {
            text: 'ファイルのBlobURL',
            value: 'blobURL'
          }
        ]
      }
    };
  }
  async getData(args) {
    const id = args.ID;
    const projectJsn = await SBDL.downloadProjectFromID(id);
    const arrayBuffer = projectJsn.arrayBuffer;
    const blob = new Blob([arrayBuffer], {
      type: 'application/octet-stream'
    });
    const url = URL.createObjectURL(blob);
    lastDataID = id;
    lastDataTitle = projectJsn.title;
    lastDataBlob = url;
    return;
  }
  returnData(args) {
    const dataType = args.DataType;
    switch(dataType){
      case 'id':
        return lastDataID;
      case 'title':
        return lastDataTitle;
      case 'blobURL':
        return lastDataBlob;
      default:
        return '不正なデータタイプです';
    }
  }
}

Scratch.extensions.register(new getSb());